import React from 'react';
import ClauseRenderer from './ClauseRenderer';
import MentionRenderer from './MentionRenderer';
import TextRenderer from './TextRenderer';

function NodeRenderer({ node }) {
  if (!node) {
    console.log('NodeRenderer: Node is undefined.'); // Check if node is undefined
    return null;
  }

  console.log('NodeRenderer node:', node); // Check the node being processed

  switch (node.type) {
    case 'h1':
      console.log('Rendering h1:', node); // Check h1 nodes
      return (
          <h1>
            {node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </h1>
      );
    case 'p':
      console.log('Rendering p:', node); // Check p nodes
      return (
          <p>
            {node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </p>
      );
    case 'ul':
      console.log('Rendering ul:', node); // Check ul nodes
      return (
          <ul>
            {node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </ul>
      );
    case 'li':
      console.log('Rendering li:', node); // Check li nodes
      return (
          <li>
            {node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </li>
      );
    case 'h4':
      console.log('Rendering h4:', node); // Check h4 nodes
      return (
          <h4>
            {node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </h4>
      );
    case 'lic':
      return (
          <div>
            {node.children && node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </div>
      );
    case 'block':
      return (
          <div>
            {node.children && node.children.map((child, index) => (
                <NodeRenderer key={index} node={child} />
            ))}
          </div>
      );
    case 'clause':
      return <ClauseRenderer node={node} />;
    case 'mention':
      return <MentionRenderer node={node} />;
    default:
      if (node.text) {
        return <TextRenderer node={node} />;
      }
      console.log('NodeRenderer: Unknown node type:', node.type); // Check for unknown types
      return null;
  }
}



const ContractRenderer = ({ data }) => {
  if (!data || !Array.isArray(data)) return null;

  const renderNode = (node) => {
    if (typeof node.text === "string") {
      let style = {};
      if (node.bold) style.fontWeight = "bold";
      if (node.underline) style.textDecoration = "underline";
      if (node.color) style.backgroundColor = node.color;

      return <span style={style}>{node.text}</span>;
    }

    switch (node.type) {
      case "h1":
        return <h1>{node.children.map(renderNode)}</h1>;
      case "h4":
        return <h4>{node.children.map(renderNode)}</h4>;
      case "p":
        return <p>{node.children.map(renderNode)}</p>;
      case "ul":
        return <ul>{node.children.map(renderNode)}</ul>;
      case "li":
        return <li>{node.children.map(renderNode)}</li>;
      case "lic":
        return <>{node.children.map(renderNode)}</>;
      case "mention":
        return <span style={{ backgroundColor: node.color }}>{node.children.map(renderNode)}</span>;
      case "block":
      case "clause":
        return <div>{node.children.map(renderNode)}</div>;
      default:
        return null;
    }
  };

  return <div>{data.map(renderNode)}</div>;
};

export default NodeRenderer;
